import Inpatients from "./pages/Inpatients";

function App() {
  return (
    <Router>
      <Routes>
        {/* üîê Login */}
        <Route path="/" element={<Login />} />

        {/* üë©‚Äç‚öïÔ∏è Nurse */}
        <Route path="/nurse" element={<NurseDashboard />} />

        <Route
          path="/nurse/emergency"
          element={<EmergencyCases key="emergency-page" />}
        />

        <Route
          path="/nurse/inpatients"
          element={<Inpatients key="inpatient-page" />}
        />

        {/* üë®‚Äç‚öïÔ∏è Doctor */}
        <Route path="/doctor" element={<DoctorDashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
